import React from 'react'

import './ErrorMessage.scss'

export default function ErrorMessage(props) {
    return (
        <>
            {this.props.message ?
                <div id="error-message">
                    <p>{this.props.message}</p>
                </div>
            : null}
        </>
    );
}
